        "title": "Libro Azzurro",
        "excerpt":"Libro Azzurro”   LIBRO AZZURRO”   [Page 11]   LIBRO DE ALBORI, FRUTICI ET IN VOGLI”   Considerando io, Piero Antonio Michiel fu de Messer Marco, che l’ordine in tutte le ationi sonno apreciabile, però al meglio io ho saputo, ho partito le varietà delle piante in diversi libri aciò siano manco confusi et reduti in manco volume essendo partiti in quatro distinte opere, zioè questa di Albori, frutici et invogli (1), la seconda di Herbe aculeate et di radici bulbose et rotonde, il terzio di Piante legnose et di piante con radice capillare et sottille, il quarto di Herbe con radice carnose et grosse, dunde l’huomo saperà (2) più al facile ritrovare quello che desidera governandosi da questo ordine saperà in qual libro son la pianta che ricerca. Et ogni libro harà (3) il suo indice et alfabeto con tutte le varietà de sinonomi ho possuto intravenire, acioché tanto il latin quanto il volgare et tanto il greco quanto l’aleman et altre nationi anche possi ogni uno per il suo nome intravenire in quello che desidera, et pigliarne quella utilità et inteligentia che potrà, dando colpa al debil et pocho saper mio, cogliendo qualche rosa, se pure ne serano, tra tanti spini.   [Qui appare chiaro l’ordine propostosi dall’Autore il quale spartì le piante in quattro divisioni artificiali: 1° Piante legnose e piante volubili contenute nel presente libro Azzurro. 2° Erbe a radice bulbosa o tuberosa ed erbe spinose contenute nel libro Giallo. 3° Piante con radici legnose o sottili nel libro Rosso. 4° Erbe con radici a fittone nel libro Verde. Conoscendo già per pratica che sono più numerose le piante della divisione terza, egli fece fare i libri più o meno ricchi di pagine secondo il numero probabile di piante che dovevano allogarvisi, perciò il maggiore fu il rosso, seguirono in grandezza il verde, l’azzurro, il giallo. Contuttociò il libro rosso divenne insufficiente perché l’Autore vi allogava oltre le piante a radice sottile, tutte quelle a radice sconosciuta, da ciò ne [Page 12] venne l’aggiunta di un secondo libro rosso che in un punto del codice (Ro. I. 177) è chiamato libro nuovo. Di mano in mano che cresceva il numero delle piante, riconobbe l’Autore l’insufficienza di questa primitiva classificazione, quindi la modificò una prima volta nel libro rosso, un’altra nel libro verde come si legge nelle relative introduzioni. Però queste due nuove classificazioni furono semplicemente esposte e l’Autore non potè metterle in pratica, perché ciò avrebbe portato uno spostamento nelle pagine ormai numerate ed un conseguente cangiamento dei numeri spesso citati al capitolo Genera. Già il Morelli avvertì che gli indici alfabetici promessi dall’Autore in questo esordio mancano nel Codice. Le pagine bianche che si trovano, non solo in fine ma anche nel corpo dei libri tenderebbero a provare che il Michiel non considerava finito il suo lavoro e si riservava di far l’indice quando il codice fosse pronto per le stampe, ma che la morte quasi improvvisa ne lo impedì].   1Invogli, cioè piante volubili, quindi il primo libro comprende le piante legnose e le rampicanti.   2Saprà.   3Avrà.  ","categories": [],
